import { Component } from "react";
import { Panel } from "./Navigator";
import { Field } from "./PlayField";


export class App extends Component {
  state = {
    userLog: false
  }

  render() {
    return (
      <div className="App">
        <Panel />
        <Field />
      </div>
      )
  }
}

export default App;
